settings.markdownTextFunction:
var markdown = '';
markdown += '#### Charging ports';
markdown += '\n';
markdown += '| Name   |      Status      |  Port type  |  Max port power    |\n';
markdown += '|--------|------------------|-------------|-------------------:|\n';
if (data) {
    data.sort(function (port1, port2) {
       return port1.Name.localeCompare(port2.Name); 
    });
    for (var i = 0; i < data.length; i++) {
        var port = data[i];
        // debugger;
        var portDataString = encodeURIComponent(JSON.stringify(port));
        var portNameLink = '<a id="portDetails" data-port-data="'+ portDataString +'" href="javascript:void(0);">'+ port.Name +'</a>';
        var portStatusSpan = '<span style="color: ' + (port.status === 'occupied' ? 'red' : 'green') + ';">' + port.status + '</span>';
        markdown += '|'+portNameLink+'|'+portStatusSpan+'|'+port.portType+'|'+port.maxPortPower+'|\n';
    }
}
markdown += '\n\n';
markdown += '<a id="chargingStationDetails" href="javascript:void(0);">Charging station details</a>\n\n';
return markdown;

