elementClick.customFunction:
var target = $event.target;
var portDataString = decodeURIComponent(target.getAttribute('data-port-data'));
var portData = JSON.parse(portDataString);

var parentStateParams = widgetContext.dashboard.stateController.getStateParams();
var chargingPortParams = {
    entityName: portData.entityName,
    entityId: {
        id: portData.entityId,
        entityType: portData.entityType
    }
};

var states = [
    {id: 'charging_ports', params: parentStateParams},
    {id: 'charging_port', params: chargingPortParams}
];

widgetContext.stateController.pushAndOpenState(states);
